            <p>M.A. - Software Engineering</p>
            <p>Faculty of Mathematics and Computer Science</p>
          </div> */}

          <div>
            <div style={{ display: 'flex', flexDirection:'row' }}>
              <BulletPoint src={Bullet} alt="Bullet" />
              <p>B.S. - Computer Science</p>
            </div>
            <p>Faculty of Mathematics and Computer Science</p>
          </div>

          {/* <div>
            <BulletPoint src={Bullet} alt="Bullet" />

            <p>B.A. - Communication and Public Relations</p>
            <p>Faculty of Political Science, Administration and Communication</p>
          </div> */}

        </Column>
        <Column>
          <div style={{ display: 'flex' }}>
            <img src={TeachingIcon} />
            <p style={{ marginLeft: 8, fontSize: 20, fontWeight: 'bold' }}>Teaching</p>
          </div>
        </Column>
        <Column>
          <div style={{ display: 'flex' }}>
            <img src={HobbyIcon} />
            <p style={{ marginLeft: 8, fontSize: 20, fontWeight: 'bold' }}>Hobbies</p>
          </div>
        </Column>
      </ColumnsContainer>
    </PageContainer>
  );
};

export default AboutMe;
